import React from 'react';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
  TimeScale
} from 'chart.js';
import { Line } from 'react-chartjs-2';
import 'chartjs-adapter-date-fns';

// Register Chart.js components
ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
  TimeScale
);

const AnxietyRiskChart = ({ 
    title, 
    data, 
    threshold, 
    baseRatio, 
    periodLabel, 
    ageGroup,
    description 
}) => {
    if (!data || data.length === 0) {
        return (
            <div className="risk-chart-container">
                <h3>{title}</h3>
                <p>No data available</p>
            </div>
        );
    }

    const chartData = {
        labels: data.map(d => d.x),
        datasets: [{
            label: 'PM2.5 Levels',
            data: data,
            borderColor: 'rgb(75, 192, 192)',
            tension: 0.1,
            fill: false
        }]
    };

    const chartOptions = {
        responsive: true,
        maintainAspectRatio: false,
        scales: {
            x: {
                type: 'time',
                time: {
                    unit: 'day',
                    displayFormats: {
                        day: 'MMM d'
                    }
                },
                title: {
                    display: true,
                    text: 'Date'
                }
            },
            y: {
                beginAtZero: true,
                title: {
                    display: true,
                    text: 'PM2.5 (μg/m³)'
                }
            }
        },
        plugins: {
            legend: {
                display: true,
                position: 'top'
            },
            title: {
                display: true,
                text: title
            },
            tooltip: {
                callbacks: {
                    label: (context) => {
                        return `PM2.5: ${context.parsed.y.toFixed(2)} μg/m³`;
                    },
                    afterBody: () => [
                        `Threshold: ${threshold} μg/m³`,
                        `Base Ratio: ${baseRatio}`,
                        `Period: ${periodLabel}`
                    ]
                }
            }
        }
    };

    return (
        <div className="risk-chart-container">
            <div className="chart-header">
                <h3>{title}</h3>
                <p className="age-notice">Results applicable for {ageGroup}</p>
                <p className="period-notice">Based on {periodLabel} measurements</p>
            </div>
            <div style={{ height: '300px', position: 'relative' }}>
                <Line data={chartData} options={chartOptions} />
            </div>
            <style jsx>{`
                .risk-chart-container {
                    padding: 15px;
                }
                .chart-header {
                    margin-bottom: 15px;
                }
                .age-notice, .period-notice {
                    font-size: 0.9em;
                    color: #666;
                    margin: 5px 0;
                }
            `}</style>
        </div>
    );
};

export default AnxietyRiskChart;
